import './App.css';
import { useState } from 'react';

function App() {
  const [count, setCount] = useState(3);
  const [Acount, setAcount] = useState(5);

  const test = (value) => {

    const data = isNaN(value);
    if(data === false) {
      console.log("int", value);
    }
    else if(data === true){
      console.log("String", value);

    }

    console.log(value)
  }



  return (
    <div className="App">
      {count}
      <br />
      {Acount}
      <button onClick={() => {test(1)}}>
        1
      </button>
      <button onClick={() => {test("+")}}>
        +
      </button>

    </div>
  );
}

export default App;
